import React from 'react';
import Header_main from './components/Header_main'
import News_header from './components/News_header';
import Blog_main from './components/Blog_main';
import Navbar from './components/Navbar';

function App() {
  return (
    <body>
    <main className='Main'>
      <header>
        <Header_main/>
      </header>
      <aside>
        <Navbar/>
      </aside>
      <div class="content">
        <News_header/>
        <Blog_main/>
      </div>  
    </main>
    </body>
  );
  
}

export default App;
